const initialState = {
	quizlistTabledata: []
};

const reducer = (state = initialState, action = {}) => {
	switch (action.type) {
		case "PUSH QUIZLIST DATA":
			return {
				quizlistTabledata: action.data
			};
			break;
		default:
			return state;
	}
};

export default reducer;
